import { AiFillEdit } from "react-icons/ai";
import {
  CardContainer,
  Title,
  Description,
  Row,
  Col,
  InfoContainer,
  Label,
  EditButton,
  DataContainter,
} from "./styles";

const Card = ({ name, description, type, quantity }) => {
  return (
    <CardContainer>
      <DataContainter>
        <Col>
          <Title>{name}</Title>
          <Description>{description}</Description>
        </Col>
      </DataContainter>
      <InfoContainer>
        <Col>
          <Label>Tipo: {type}</Label>
          <Label>Quantidade: {quantity}</Label>
          <EditButton>
            <AiFillEdit /> Editar
          </EditButton>
        </Col>
      </InfoContainer>
    </CardContainer>
  );
};

export default Card;
